import React from 'react';

const UserForm = () => {
    return (
        <div>
            <form action="">
                <div className='d-flex justiy-content-evenly'>
                    <label htmlFor="userEmail">h</label>
                    <input type="email" id='userEmail' placeholder='Enter Your Email'/>
                </div>
            </form>
        </div>
    );
};

export default UserForm;
